<p align="center"><img border="0" height="491" src="images/Dipylidium better.jpg" width="543"/><br/>
<i>Dipylidium caninum</i> from a dog.  This photo reveals proglottids of 
all degrees of maturity.  The gravid proglottids have a cucumber seed 
shape.  The fine thread-like form is the scolex.  </p>
